import React from 'react'
import { Button, Card } from 'react-bootstrap'
import foto from '../../assets/image/avatar.png'
import DataProject from './DataProject.json'
import { ProjectImg, ProjectList } from './Project.style'

export default function Project() {
  return (
    <ProjectList>
        {
            DataProject.map( data => {
                let url = data.src
                return(
                    <Card style={{ width: '18rem' }} key={data.id}>
                        {/* <Card.Img src={data.src} className='projectImg'/> */}
                        <ProjectImg src={data.src} className='projectImg'/>
                        <Card.Body>
                            <Card.Title>Hello</Card.Title>
                            <Card.Text>
                            Some quick example text to build on the card title and make up the bulk of
                            the card's content.
                            </Card.Text>
                            <Url>

                            <Button variant="warning">Go somewhere</Button>
                            </Url>
                        </Card.Body>
                </Card>
                )
            })
        }
    </ProjectList>
  )
}
